import React from 'react';
import './App.css';
import Navbar from './components/layout/Navbar';
import logo from './assets/logo.svg';


function App() {
  return (
    <>
      <div style={{backgroundImage: `url($logo})`}} className="navbar-bg">
          <Navbar />
      </div>
    </>
  );
}

export default App;
